/**
 * @param {string[]} words
 * @param {string} target
 * @return {number}
 */

 var numWays2 = function(words, target) {
    let n = words.length;
    let wn = words[0].length;
    let wordsCache = new Array(n).fill(0).map(() => new Array(26).fill(0).map(() => []));
    for(let i = 0; i < n; i++) {
        for(let j = 0; j < wn; j++) {
            wordsCache[i][words[i].charCodeAt(j) - 97].push(j);
        }
    }
    //console.log(wordsCache.join(' '));

    let tlen = target.length;
    let dp = new Array(n).fill(0).map(() => new Array(wn).fill(0).map(() => new Array(tlen).fill(0)));
    
    //初始化第一个
    let ti = 0;
    let tar = target.charCodeAt(ti);
    //words words i 的位置 target为k的数量，
    let preLen = new Array(wn).fill(0).map(() => new Array(tlen).fill(0));

    for(let j = 0; j < n; j++) {
        if(ti == 0) {
            let table = wordsCache[j][tar - 97];
            for(let tai = 0; tai < table.length; tai++) {
                dp[j][table[tai]][ti]++;                
            }
        }
    }

    
    for(let ki = 0; ki < wn; ki++) {
        for(let j = 0; j < n; j++) {
            preLen[ki][0] += dp[j][ki][0]; 
        }
        if(ki > 0) {
            preLen[ki][0] += preLen[ki - 1][0]; 
        }        
    }



    for(let ki = 1; ki < wn; ki++) {
        //console.log(preLen.join('='));
        for(let j = 0; j < n; j++) {
            for(let ti = 1; ti < tlen; ti++) {
                if(words[j].charCodeAt(ki) == target.charCodeAt(ti)) {
                    dp[j][ki][ti] += preLen[ki - 1][ti - 1]%MOD;
                }
                
            }
        }

        for(let ti = 1; ti < tlen; ti++) {            
            for(let j = 0; j < n; j++) {
                preLen[ki][ti] += dp[j][ki][ti]%MOD;; 
            }
            if(ki > 0) {
                preLen[ki][ti] += preLen[ki - 1][ti]%MOD;; 
            }        
        }
        //console.log(dp.join('='));
    }
    return preLen[wn - 1][tlen - 1]%MOD;

};

