var numWays3 = function(words, target) {
    let n = words.length;
    let wn = words[0].length;
    let tlen = target.length;
    let dp = new Array(n).fill(0).map(() => new Array(wn).fill(0).map(() => new Array(tlen).fill(0)));
    
    //words words i 的位置 target为k的数量，
    let preLen = new Array(wn).fill(0).map(() => new Array(tlen).fill(0));

    for(let ki = 0; ki < wn; ki++) {
        //console.log(preLen.join('='));
        for(let j = 0; j < n; j++) {           
            for(let ti = 0; ti < tlen && ti <= ki; ti++) {                    
                if(words[j].charCodeAt(ki) == target.charCodeAt(ti)) {                       
                    if(ti == 0 || ki == 0) {
                        dp[j][ki][ti] = 1;
                    } else {
                        dp[j][ki][ti] += preLen[ki - 1][ti - 1]%MOD;
                    }
                    
                }                    
            }                        
        }

        for(let ti = 0; ti < tlen; ti++) {            
            for(let j = 0; j < n; j++) {
                preLen[ki][ti] += dp[j][ki][ti]%MOD;; 
            }
            if(ki > 0) {
                preLen[ki][ti] += preLen[ki - 1][ti]%MOD;; 
            }        
        }
        //console.log(dp.join('='));
    }
    return preLen[wn - 1][tlen - 1]%MOD;

};

