var numWays4 = function(words, target) {
    let n = words.length;
    let wn = words[0].length;
    let tlen = target.length;
    let dp = new Array(n).fill(0).map(() => new Array(tlen).fill(0));
    
    //words words i 的位置 target为k的数量，
    let preLen = new Array(tlen).fill(0);
    let dpZero = new Array(n).fill(0);

    for(let ki = 0; ki < wn; ki++) {
        //console.log(preLen.join('='));
        for(let j = 0; j < n; j++) {           
            for(let ti = 0; ti < tlen; ti++) {                    
                if(words[j].charCodeAt(ki) == target.charCodeAt(ti)) {                       
                    if(ti == 0) {
                        dpZero[j]++;
                        dp[j][ti] = dpZero[j];
                    } else {
                        dp[j][ti] += preLen[ti - 1]%MOD;
                    } 
                }                    
            }                        
        }

        preLen.fill(0);
        for(let ti = 0; ti < tlen; ti++) {            
            for(let j = 0; j < n; j++) {
                preLen[ti] += dp[j][ti]%MOD;; 
            }   
        }
        // console.log(`ki=${ki} ${dp.join('=')}`);
        // console.log(preLen);
    }
    return preLen[tlen - 1]%MOD;

};
