var numWays5 = function(words, target) {
    let n = words.length;
    let wn = words[0].length;
    let tlen = target.length;
    let dp = new Array(n).fill(0).map(() => new Array(tlen).fill(0));
    
    //target为k的数量，
    let preLen = new Array(tlen).fill(0);    
    let lastLen = new Array(tlen).fill(0);    
    //每行target为0的数量
    let dpZero = new Array(n).fill(0);

    //
    let targetCache = new Array(26).fill(0).map(() => []);
    for(let i = 0; i < tlen; i++) {       
        targetCache[target.charCodeAt(i) - 97].push(i);       
    }
    
    let wordsCache = new Array(n).fill(0).map(() => new Array(26).fill(0).map(() => []));
    for(let i = 0; i < n; i++) {
        for(let j = 0; j < wn; j++) {
            wordsCache[i][words[i].charCodeAt(j) - 97].push(j);
        }
    }

    for(let ki = 0; ki < wn; ki++) {
        //console.log(preLen.join('='));        
        for(let j = 0; j < n; j++) {            
            let dstList = targetCache[words[j].charCodeAt(ki) - 97];
            if(dstList == null || dstList.length == 0) {
                continue;
            }
            for(let di = 0; di < dstList.length; di++) {
                let ti = dstList[di];
                if(ti == 0) {
                    dpZero[j]++;
                    dp[j][ti] = dpZero[j];                    
                } else {
                    //dp[j][ti] += preLen[ti - 1]%MOD;
                    dp[j][ti] += lastLen[ti - 1]%MOD;
                    preLen[ti] += lastLen[ti - 1]%MOD;   
                }                
            }                             
        }

        preLen[0] = 0;
        for(let j = 0; j < n; j++) {
            preLen[0] += dpZero[j];
        }

        lastLen.forEach((value,index) => {
            lastLen[index] = preLen[index];
        });        
        // console.log(`ki=${ki} ${dp.join('=')}`);
        // console.log(lastLen);
    }
    return lastLen[tlen - 1]%MOD;

};

