//PASS 分成第0个，和其他的两种，其他的用乘法
var numWays = function(words, target) {
    let n = words.length;
    let wn = words[0].length;
    let tlen = target.length;   
    //target为k的数量，
    let preLen = new Array(tlen).fill(0);    
    let lastLen = new Array(tlen).fill(0);    
    //每行target为0的数量
    let dpZero = new Array(n).fill(0);

    //
    let targetCache = new Array(26).fill(0).map(() => []);
    for(let i = 1; i < tlen; i++) {       
        targetCache[target.charCodeAt(i) - 97].push(i);       
    }

    for(let ki = 0; ki < wn; ki++) {
        //console.log(preLen.join('='));
        let wordsCache = new Array(26).fill(0).map(() => []);
        for(let j = 0; j < n; j++) {             
            wordsCache[words[j].charCodeAt(ki) - 97].push(j);            
        }
        //计算第0个
        let zeroList = wordsCache[target.charCodeAt(0) - 97];
        if(zeroList != null) {
            for(let zi = 0; zi < zeroList.length; zi++) {
                dpZero[zi]++;   
            }
        }
        //计算其他的
        for(let aj = 0; aj < 26; aj++) {
            if(wordsCache[aj].length == 0) {
                continue;
            }
            let dstList = targetCache[aj];
            if(dstList == null || dstList.length == 0) {
                continue;
            }
            //当前的数量，等于前一个的数量乘以当前字母的数量
            for(let di = 0; di < dstList.length; di++) {
                let ti = dstList[di];
                preLen[ti] += (lastLen[ti - 1] * wordsCache[aj].length)%MOD;              
            }  
        }

        preLen[0] = 0;
        for(let j = 0; j < n; j++) {
            preLen[0] += dpZero[j];
        }

        lastLen.forEach((value,index) => {
            lastLen[index] = preLen[index];
        });        
        // console.log(`ki=${ki} ${dp.join('=')}`);
        // console.log(lastLen);
    }
    return lastLen[tlen - 1]%MOD;

};

